import React from 'react';
import Lugu from './Lugu';
import './Menu.scss';


interface Song {
    artist: string;
    songName: string;
    duration: number
}

const Menu: React.FC<Song> = () => {
    return(
        <div className="menu">
            {/* valitud loo preview */}
            <div className="container1">
                <Lugu />
            </div>
            {/* lugude list */}
            <div className="container2">
                <ul className="container2 list">
                    <li>Katy Perry - Fireworks</li>
                    <li>50 Cent - In Da Club</li>
                    <li>Eminem - Not Afraid</li>
                    <li>Lil Wayne - Lollipop</li>
                    <li>Soulja Boy- Killswitch</li>
                </ul>
            </div>
        </div>
    )
}

export default Menu;
